import React from "react";

const Privacy = () => {
  return (
    <div className="max-w-7xl mx-auto p-6">
      <h1 className="text-2xl font-bold mb-4">Gizlilik Politikası</h1>
      <p>
        Buraya gizlilik politikası içeriği gelecek.
      </p>
    </div>
  );
};

export default Privacy;
